import React from 'react'

import {Menu, MenuTitle, Burgers} from './homestyled'

export default function index() {
    return (
        <>
            <Menu>
                <MenuTitle>Menu</MenuTitle>
                <Burgers>
                    {[1,2,3,4].map(el => {
                        return (
                            <span key={el}>{el}</span>
                        );
                    })}
                </Burgers>
            </Menu>
        </>
    )
}
